import Logo from "/components/logo192.png";

function Header() {
    return (
    <nav>
        <img src={Logo} alt="react-logo"/>
        <ul>
            <li><a href="index.html">Home</a></li>
            <li>About</li>
            <li>Contact</li>
        </ul>
    </nav>
    );
}

export default Header;
